import{_ as e,o as t,c as p,e as a}from"./app.acfc35a6.js";const _={},c=a('<h1 id="事件有哪些修饰符" tabindex="-1"><a class="header-anchor" href="#事件有哪些修饰符" aria-hidden="true">#</a> 事件有哪些修饰符</h1><p>事件修饰符</p><p>.stop 阻止事件继续传播 .prevent 阻止标签默认行为 .capture 使用事件捕获模式,即元素自身触发的事件先在此处处理，然后才交由内部元素进行处理 .self 只当在 event.target 是当前元素自身时触发处理函数 .once 事件将只会触发一次 .passive 告诉浏览器你不想阻止事件的默认行为</p><p>v-model 的修饰符</p><p>.lazy 通过这个修饰符，转变为在 change 事件再同步 .number 自动将用户的输入值转化为数值类型 .trim 自动过滤用户输入的首尾空格</p><p>键盘事件的修饰符</p><p>.enter .tab .delete (捕获“删除”和“退格”键) .esc .space .up .down .left .right</p><p>系统修饰键</p><p>.ctrl .alt .shift .meta</p><p>鼠标按钮修饰符</p><p>.left .right .middle</p><p>作者：一尾流莺 链接：https://juejin.cn/post/7064368176846340132 来源：稀土掘金 著作权归作者所有。商业转载请联系作者获得授权，非商业转载请注明出处。</p>',12),r=[c];function n(s,o){return t(),p("div",null,r)}const l=e(_,[["render",n],["__file","09.事件有哪些修饰符？.html.vue"]]);export{l as default};
